import React from 'react';
import './App.css';
import { MDBBtn } from 'mdb-react-ui-kit';
import "@material-ui/core";
import "@material-ui/icons";
import { MDBInput } from 'mdb-react-ui-kit';  
import { MDBDropdown, MDBDropdownMenu, MDBDropdownToggle, MDBDropdownItem, MDBDropdownLink } from 'mdb-react-ui-kit';
import SearchIcon from '@material-ui/icons/Search';




function SortByContent(props) {
  
filterSelection("all")
function filterSelection(c) {
  var x, i;
  x = document.getElementsByClassName("filterItem");
  if (c == "all") c = "";
  // Add the "show" class (display:block) to the filtered elements, and remove the "show" class from the elements that are not selected
  for (i = 0; i < x.length; i++) {
    w3RemoveClass(x[i], "show");
    if (x[i].className.indexOf(c) > -1) w3AddClass(x[i], "show");
  }
}

// Show filtered elements
function w3AddClass(element, name) {
  var i, arr1, arr2;
  arr1 = element.className.split(" ");
  arr2 = name.split(" ");
  for (i = 0; i < arr2.length; i++) {
    if (arr1.indexOf(arr2[i]) == -1) {
      element.className += " " + arr2[i];
    }
  }
}

// Hide elements that are not selected
function w3RemoveClass(element, name) {
  var i, arr1, arr2;
  arr1 = element.className.split(" ");
  arr2 = name.split(" ");
  for (i = 0; i < arr2.length; i++) {
    while (arr1.indexOf(arr2[i]) > -1) {
      arr1.splice(arr1.indexOf(arr2[i]), 1);
    }
  }
  element.className = arr1.join(" ");
}

// Add active class to the current control button (highlight it)
var btnContainer = document.getElementById("filterBtn");
var btns = btnContainer.getElementsByClassName("filterBtns");
for (var i = 0; i < btns.length; i++) {
  btns[i].addEventListener("click", function() {
    var current = document.getElementsByClassName("active");
    current[0].className = current[0].className.replace(" active", "");
    this.className += " active";
  });
}

    return (
        <div className="sort_table">
            <div className="search_property">
                <div className="icon_flex">
            </div>
            </div>
            <div className="property_sorting">
            <div className="property_list">
            <MDBDropdown>
      <MDBDropdownToggle className="property_dropdown">Property Type</MDBDropdownToggle>
      <MDBDropdownMenu className="property_dropdown_2">
        <MDBDropdownItem>
          <MDBDropdownLink href="#" className="filterBtn">Homes</MDBDropdownLink>
        </MDBDropdownItem>
        <MDBDropdownItem>
          <MDBDropdownLink href="#">Apartments</MDBDropdownLink>
        </MDBDropdownItem>
        <MDBDropdownItem>
          <MDBDropdownLink href="#">Offices</MDBDropdownLink>
        </MDBDropdownItem>
      </MDBDropdownMenu>
    </MDBDropdown>
            </div>
            
            <div className="property_price">
            <MDBDropdown>
      <MDBDropdownToggle className="property_dropdown">Price</MDBDropdownToggle>
      <MDBDropdownMenu className="property_dropdown_2">
        <MDBDropdownItem>
          <MDBDropdownLink href="#">Lowest to Highest</MDBDropdownLink>
        </MDBDropdownItem>
        <MDBDropdownItem>
          <MDBDropdownLink href="#">Highest to Lowest</MDBDropdownLink>
        </MDBDropdownItem>
      </MDBDropdownMenu>
    </MDBDropdown>
    </div>
            <div className="agent_list">
            <MDBDropdown>
      <MDBDropdownToggle className="property_dropdown">Agents</MDBDropdownToggle>
      <MDBDropdownMenu className="property_dropdown_2">
        <MDBDropdownItem>
          <MDBDropdownLink href="#">Agent John Ryan</MDBDropdownLink>
        </MDBDropdownItem>
        <MDBDropdownItem>
          <MDBDropdownLink href="#">Agent Kevin Richmond</MDBDropdownLink>
        </MDBDropdownItem>
        <MDBDropdownItem>
          <MDBDropdownLink href="#">Agent Mary Williams</MDBDropdownLink>
        </MDBDropdownItem>
      </MDBDropdownMenu>
    </MDBDropdown>
    </div>
            </div>
            <MDBBtn className="hero_button" href="/AllProperties">Search</MDBBtn>
            
        </div>
    )
}

export default SortByContent
